import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { CssBaseline, Container, Paper, Card } from '@material-ui/core';

export default function FormationCanvas(){

    return (
        <React.Fragment>
            <CssBaseline>
                <Container fixed>
                    <Grid spacing={2} justify="center">
                        <Card>Front</Card>
                        <Paper>Stage</Paper>
                        <Card>Back</Card>
                    </Grid>
                </Container>
            </CssBaseline>
        </React.Fragment>
    );
}
